INSERT INTO `tbl_cattle` (`id`, `name`, `dob`, `category`, `height`, `description`, `icon`, `sire`, `dam`, `video`, `link`, `section`, `friendly_name`)
VALUES
	(1,'Moeskaer Alma','2013-03-05','Heifer','','<p>Has 2016 <strong>Square-D Tortuga calf at foot.</strong> Medium sized cow family, with strong fleshy build. Have Great hope for this cow within our herd for the future and will be One of the Polled Hereford Families we will be pushing Forward. A cow that maintains condition very well, has great milk and good breeder.<strong><br /></strong></p>','','Nbg 69t The Wonderer 36R ET 3W','Moeskaer Alma 1201','','','females','ALMA'),
	(2,'Moeskaer Donna','2013-04-25','Heifer','','<p>DK069957 01424</p>','','Square-D Diesel 957u','71404-00879','','','females','DONNA'),
	(3,'Moeskaer Flora','2013-05-24','Heifer','','<p>Flora is one of the Strongest and Largest Polled Hereford breeding Families we have. In the Top 1% for 200,400,600 day weight. Top 5% for milk, and again top 1% for Terminal Index and Self Replacing Index. She has a 2016 Bull Calf at foot, sired by our Galaxy Bull.</p>','','Star-Lake Dandy 614r','Moeskaer Flora 1301','','http://abri.une.edu.au/online/cgi-bin/i4.dll?1=3E372928&2=2420&3=56&5=2B3C2B3C3A&6=27595C26232423272F&9=5B525B5F','females','FLORA'),
	(4,'Moeskaer Kema','2013-06-03','Heifer','','<p>A strong<strong> Barefoot Mr You Tube calf at foot. </strong>Born Jan 2016. <strong><br /></strong></p>','','Moeskaer Salute','Moeskaer Kema 1132-ET','','','females','KEMA'),
	(5,'Moeskaer Megan','2013-06-07','In Calf Heifer','','<p>In calf to <strong>Square-D Tortuga</strong></p>','','Moeskaer Packer 1354','Moeskaer Megan 1079 ET','','','females','MEGAN'),
	(6,'Princess Family','2012-07-05','Cow','','<p>Princess family will always be a favorite. Great temperament, has a Galaxy Heifer Calf which has taken on all of her Features. This cow was flushed in 2015 with 3 egg being implanted directly into recipients. Again another Strong breeder we will be pushing in the Fabb Herd Polled Herfords for the future.</p>','','Wilgor 55k Northeatern OL 2N','Mhpa Ms 24k Princess 1195N','','http://abri.une.edu.au/online/cgi-bin/i4.dll?1=3E372928&2=2420&3=56&5=2B3C2B3C3A&6=27595C262324242E2D&9=5B525B5F','females','PRINCESS'),
	(7,'Moeskaer Eudora','2013-04-08','Heifer','','<p>In Calf to <strong>Square-D Tortuga</strong></p>','','Moeskaer Salute 994','Moeskaer Eudora 1253','','','females','EUDORA'),
	(8,'Fabb 1 Popinjay','2013-03-22','In calf Heifer','','<p>Has one our most promising 2016 Bull Calves at foot sired by <strong>Square-D Tortuga. </strong>One of our first Polled Hereford Families, Strong breeder, good Milk.<strong><br /></strong></p>','','Blackwell 1 Hector','Hartshorne 1 Popinjay 19th','','','females','POPINJAY'),
	(9,'Fabb 1 Snowdrop','2013-04-05','Herd sires','','<p>Has January 2016 Square-D Tortuga calf at foot<strong>. </strong>A Promising Polled Hereford Prospect for the future. Good strong Breeder with good milk. Has Been a Great Family for us on the Show Circuit. Her Half Sister Fabb 1 Mia, came first in class at the National Hereford Calf Show 2015.<strong><br /></strong></p>','','Blackwell 1 Hector','Hartshorne 1 Snowdrop 26th','','','females','SNOWDROP'),
	(11,'Moeskaer April','2014-03-25','Heifer','','<p>Breed champion at Nottingham County show 2015</p>\r\n<p>Junior champion at Rutland show 2015</p>\r\n<p>Female Champion at Suffolk show 2015</p>','','W11 Global Force','Moeskaer Fanny','','','females','APRIL'),
