	(16,'Moeskaer Keepsake 1448','2014-02-07','','','','','Remitall Pilgrim 93P','Moeskaer Keepsake 1158','','http://abri.une.edu.au/online/cgi-bin/i4.dll?1=3E372928&2=2420&3=56&5=2B3C2B3C3A&6=27595C262223222E2D&9=5B525B5F','females','KEEPSAKE'),
	(19,'Square-D Tortuga 953T','2007-03-11','','','','','Wilgor 55K Notheastern OL 2N','Square-D Ameena 753Mu','','','ai-sires','SQUARE-D TORTUGA'),
	(20,'Wll Global Force 7X','2010-01-07','','','<p><span style=\"font-family: verdana, arial, helvetica; -webkit-text-size-adjust: auto;\">Global Force combines two of the most dominant bloodlines with WLB Global 72M 50S on the top side and FORC 29F Boomer 18L on the bottom side. Both lines are noted for their abilities to provide moderate birth weight with exceptional growth and muscle.</span></p>','','Wlb Global 72M 50S','Corp Creek Stacie 6S','','','ai-sires','WLL GLOBAL FORCE 7X'),
	(21,'AXA Golden-Oak XCEED ET 704X','2010-02-24','','','<ul>\r\n<li style=\"font-family: verdana, arial, helvetica; -webkit-text-size-adjust: auto;\">Xceed provides exceptional balance across the board from birth weight to growth, maternal and carcass.&nbsp;</li>\r\n<li style=\"font-family: verdana, arial, helvetica; -webkit-text-size-adjust: auto;\">His dam is a picture perfect female that continues to produce exceptional offspring at 9 years of age.&nbsp;</li>\r\n<li style=\"font-family: verdana, arial, helvetica; -webkit-text-size-adjust: auto;\">DLF, IEF and HYF</li>\r\n</ul>','','Shf Rib Eye M326 R117','Ncx Miss JR Nellie 528N','','','ai-sires','GOLDEN-OAK XCEED'),
	(22,'Barefoot Mr You Tube 4Y','2011-02-28','','','<ul>\r\n<li>Extreme&nbsp;thickness with meat from end to end, huge hindquarter</li>\r\n</ul>\r\n<ul>\r\n<li>Structural soundness and deep bodied</li>\r\n</ul>\r\n<ul>\r\n<li>Long bodied with perfect feet and legs</li>\r\n</ul>\r\n<ul>\r\n<li>Low birthweight and should be suitable for heifers&nbsp;</li>\r\n</ul>\r\n<ul>\r\n<li>New and fresh pedigree with lots of milk</li>\r\n</ul>','','Ncx Winchester 745W','Ncx Miss Whiplash 3W','','','ai-sires','BARE MR YOU TUBE 4Y'),
	(23,'Days Calibre G74','2011-05-19','','','<p>He is a bull who was a clear winner in the class. He has a big top and you have to appreciate his balance and eye appeal and when you see him on the move he has a lot of integrity and flexibility.</p>','','Allendale Waterhouse D1 (P)','Allendale Dawn C62 (P)','','','ai-sires','DAYS CALIBRE G74'),
	(24,'Moeskaer Crossfire 1474','2014-05-10','','','<p style=\"text-align: left;\">&nbsp;This is an ET calf with a very special pedigree. I doubt there are any other Herefords in Europe with this pedigree. His dam has won many shows in Canada and is a phenomenal female. Sire of the bull is the american sire TDP Crossover.&nbsp;His weight at 12 months is close to 700 kg!! Growth, muscle, milk, easy calving and dark colour in this calf.</p>','','TDP CROSSOVER Z400','BBSF 303T CINDY 88Y','','','herd-sires','MOESKAER CROSSFIRE'),
	(30,'Ripley Family','2016-04-01','','','','','Days Calibre G74','Moeskaer Ripley 1333','','http://abri.une.edu.au/online/cgi-bin/i4.dll?1=3E372928&2=2420&3=56&5=2B3C2B3C3A&6=27595C26212058212F&9=5B525B5F','females','RIPLEY'),
	(31,'Moeskaer Pacman 1417','2013-04-14','','','<p>Moeskaer Pacman has great body depth and length with excellent Muscle. His weight as a yearling was 725kg! He Has a Great dark coat and is now proving to past on many of traites to his offspring. Im sure this will remain a firm favorite in Fabb Herd Polled Herefords for the Future.</p>','','Harvie Tailor Made 7W','Harvie Ms Perfection 30P','','','ai-sires','MOESKAER PACMAN 1417'),
	(33,'Moeskaer Tracy 1295','2010-04-04','','','','','CCR 57G Stamina ET 199S','Moeskaer Tracy 964','','','females','TRACY'),
	(34,'Moeskaer Keepsake 1218','2008-04-04','','','','','HF 4L Beyond 36N','Golden-Oak 46B Keepsake 23k','','','females','KEEPSAKE 1218'),
	(35,'Dorepoll 1 Katie','2012-10-21','','','','','Dorepoll 1 60G Chinook','Dorepoll 1 531 Katie 556','','http://abri.une.edu.au/online/cgi-bin/i4.dll?1=3E372928&2=2420&3=56&5=2B3C2B3C3A&6=27595C262522252524&9=5B525B5F','females','KATIE'),
	(36,'Fabb 1 Northern Star','2016-01-01','','','<p>SOLD</p>','','Square-D Tortuga 953T','Fabb 1 Snowdrop','','','for-sale','FABB 1 NORTHERN STAR'),
	(37,'Fabb 1 Nicholson','2016-01-03','','','<p>Promising easy fleshing Bull, fantastic rear, with good pedigree. SOLD.</p>','','Square-D Tortuga 953T','Fabb 1 Popinjay','','','for-sale','FABB 1 NICHOLSON'),
	(39,'Moeskaer Pacman 1417','2013-04-14','','','<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong><span style=\"font-size: large;\">Grand Champion Bull of Europe 2014/2015</span></strong></p>\r\n<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong><span style=\"font-size: large;\">Grand Champion Bull, The National Show 2014</span></strong></p>\r\n<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong><span style=\"font-size: large;\">Grand Champion Bull, Agromek 2014</span></strong></p>','','Harvie Tailor Made 7W ET','Harvie Miss Perfection 30P','','','herd-sires','MOESKAER PACMAN'),
	(40,'Fabb 1 Noak','2016-01-14','','','<p>Polled Hereford Bull for Sale. Excellent smaller framed bull, full of muscle. Superb pedigree with easy calving. A real Gentleman on a halter. SOLD</p>','','Bare Mr You Tube 4Y','Moeskaer Kema 1435','','','for-sale','FABB 1 NOAK 500096'),
	(41,'Moeskaer Crossfire 1474','2014-05-10','Semen for Sale','','<p>Moeskaer Crossfire 1474. &nbsp;Semen packages available. Limited doses. Low birth weights, strong growth.</p>','','TDP Crossover Z400','BBSF 303T Cindy 88Y','','','for-sale','CROSSFIRE 1474 SEMEN'),
	(43,'Hereford Bulls for Sale','2016-03-01','','','<p>Bulls of varied breeding, mostly by Classic 1 Galaxy.</p>','','Classic 1 Galaxy','Various','','','for-sale','YOUNG BULLS FOR SALE'),
