	(48,'Fabb 1 Peter Pan','2016-09-03','','','<p>Promising young September 16 Bull. Excellent EBV\'s, good future Prospect.</p>','','Square-D Tortuga 953T','Hartshorne 1 Popinjay','','','for-sale','FABB 1 PETER PANS'),
	(49,'Fabb 1 Perfect Days','2016-08-17','','','<p>One of our best Prospects, this ET bull is from a flush of one of our best cows. Will be Joining the Fabb Herd Show team this season</p>','','Days Calibre G74','Moeskaer Princess 1395','','','for-sale','FABB 1 PERFECT DAYS'),
	(52,'Fabb 1 Pong Keno','0016-09-04','','','<p>Sired by Moekaer Keno a thick dark bull full of muscle, really strong back end.</p>','','Moeskaer Keno','Hartshorne 1 Cornelia','','http://abri.une.edu.au/online/cgi-bin/i4.dll?1=3E372928&2=2420&3=56&5=2B3C2B3C3A&6=27595C255958202123&9=5C525F5C','for-sale','FABB 1 PONG KENO'),
	(53,'Moeskaer Compass','2018-11-19','','','<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong>CHAMPION BULL OF THE WORLD<br /></strong></p>\r\n<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong>Champion Bull of Europe 2017</strong></p>\r\n<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong>Champion Bull of Europe 2016</strong></p>\r\n<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong>Interbreed Champion Of All Breeds, National Show 2016</strong></p>\r\n<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong>Grand &amp; Junior Champion Bull, National Show 2016</strong></p>\r\n<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong>Supreme Champion, National Show 2017</strong></p>\r\n<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong>Interbreed Reserve Champion, National Show 2017<br /></strong></p>\r\n<p style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; letter-spacing: normal; text-align: left;\"><strong>Grand &amp; Senior Champion Bull, National Show 2017<br /></strong></p>\r\n<p style=\"text-align: left;\"><strong>&nbsp;</strong></p>','','Remitall Pilgrim 93P','MoeskÃ¦r Kashmir 1086','','','ai-sires','MOESKAER COMPASS'),
	(54,'Fabb 1 Pure Force','2016-09-02','','','<p style=\"text-align: left;\">Semen Available, EU approved. Fabb 1 Pure Force is a dark, thick bull with sound legs, feet and a great top. His Dam is Milky and very easy fleshing.</p>','','WLL Global Force 7X','Moeskaer Fanny 1455','','http://abri.une.edu.au/online/cgi-bin/i4.dll?1=3E372928&2=242D&3=56&5=2B3C2B3C3A&6=27595C25595820222D&10=0AEEECEB2C3A2A19C3C5F1351EC4C0FEFB3F06ED033B19E03807DBE1E8ED02E8EBE90EF5C3F5AD','for-sale','FABB 1 PURE FORCE'),
	(55,'Fabb 1 Megan Pandora','2017-03-01','','','<p>Fabb 1 Megan Pandora is out of the renowned maternal Megan Family. This Heifer has great muscle and breeding potential.</p>','','Moeskaer Crossfire 1474','Moeskaer Megan 1437','','http://abri.une.edu.au/online/cgi-bin/i4.dll?1=3E372928&2=242D&3=56&5=2B3C2B3C3A&6=27595C2559222F252D&10=381C1A195A28580AE1EEE3F52211EFF1EAFEFAEA2A31183E36','for-sale','Fabb 1 Megan Pandora'),
	(56,'Heifers For Sale','2018-11-19','','','<p><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB; mso-bidi-language: AR-SA;\">Range of Bulling Heifers for sale. Unique bloodlines from both Dam and Sire. With Purchase of each Heifer we would like to offer one straws of \'Fabb 1 Pure Force&rsquo; Semen. Heifers are inspected by the vet prior to sale</span></p>','','','','','','for-sale','HEIFERS FOR SALE-18'),
	(57,'Breed Champion at Winter Stock Festival.','2018-11-19','','','<p>Fabb 1 Pacie Wins Winter Stock Festival Breed Champion 2018. Embroys will be available on request.</p>','','Moeskaer Pacman','Fabb 1 Snowdrop','','http://abri.une.edu.au/online/cgi-bin/i4.dll?1=3E372928&2=242D&3=56&5=2B3C2B3C3A&6=27595C255924242622&10=3D111F1E5F2D5D0C1AE7E0E3272E152B23010820','females','');
