INSERT INTO `tbl_pages` (`id`, `title`, `page_title`, `url`, `description`, `html`, `header`)
VALUES
	(1,'Home','Pedigree Polled Hereford Cattle For Sale UK | Hereford Cows and Bulls Breeders|The FABB Herd','home','We Offer Pedigree Polled Herefords Cattle, a herd built using Top Animals and Genetics from around the world. Pedigree Polled Bulls for sale, Cows and Heifers for sale in UK, from Elite High Health Status Herd.','<p><img src=\"../../../img/red%20tractor%20logo.jpg\" alt=\"\" width=\"10%\" align=\"left\" /><img src=\"../../../img/high%20health.png\" alt=\"\" width=\"12%\" align=\"right\" /></p>\r\n<div id=\"large-logo\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../img/logo%20clear.png\" alt=\"\" width=\"70%\" /></div>\r\n<h1>Pedigree Polled Hereford cattle</h1>\r\n<h3>A&nbsp;Herd built using Top Hereford Bulls and Hereford Genetics from around the World.</h3>\r\n<p>Our focus is on producing a milky and muscular Polled herd, with great maternal instinct, low birth weights and strong growth. Genetics are selected for there ability to product quality beef from grass based diets.</p>\r\n<p>&nbsp;Polled Hereford Bulls and Polled Hereford Heifers from Elite High Health Status Herd.&nbsp;Always a good selection of Hereford cattle for sale, including Hereford Bulls and Hereford Heifers with elite outcross genetics. &nbsp;</p>','/img/headings/1485719917-FabbHerd.jpg'),
	(2,'About','About Us | Suppliers of Hereford Bulls and Females | Fabb herd Pedigree Herefords','about','We are Pedigree Polled Hereford Breeders consisting of around 60 polled Hereford Cows, built up from mainly imported Polled Herefords and Hereford Genetics','<p style=\"text-align: center;\"><strong>The Fabb Herd Pedigree Herefords, was started&nbsp;by partners Daniel Fabb and Helen Parr. Based in Cambridgeshire a TB4 area and Elite Herd Health Status with SAC. Free from BVD, IBR, Johne\'s Disease(level 1) and Leptospirosis.<br /></strong></p>\r\n<p style=\"text-align: center;\"><strong>The Herd consists of around 60 Polled Hereford cows. Wanting to progress with different blood lines, we have imported 20 Hereford Heifers and 2 Hereford Bulls from Denmark over the past 3 years. We use 12 different Hereford AI sires.&nbsp;</strong><strong>These Have been carefully selected to suit the Hereford Female.</strong></p>\r\n<p style=\"text-align: center;\"><strong>&nbsp;Hereford Sires used within our Herd include the The Wonderer, Square-D Diesel, Remital Pilgrim, Classic 1 Galaxy, Wll Global Force 7X, Mr Youtube, Haroldson Title shot, Moeskaer Keyman, Moeskaer Keno, Moeskaer Pacman, Day Calibre, Moeskaer Crossfire and Square-D Tortuga.</strong></p>\r\n<p style=\"text-align: center;\"><strong>Polled Hereford cow families include Moeskaer Pearl from the Canadian Family Square D Pearl 37M. Moeskaer Donna 1424, Moeskaer Megan 1437 whos sister was dam to the Swedish National champion Bull, Moeskaer Tracy 1295, Moeskaer Fanny 1455, Moeskaer Keepsake 1218, Moeskaer Keepsake 1448, Moeskaer Princess 1395, Moeskaer Alma 1423, Moeskaer Flora 1432 top 1% for 200/400/600 days weight,&nbsp;Moeskaer Beauty 1470</strong><strong>. Hartshorne Families and the Fabb Families</strong></p>\r\n<p style=\"text-align: center;\"><strong>We serve the Majority of the herd Via AI. We are also running an intensive embryo program.&nbsp; Enabling us to use top Hereford genetics from around the world to further improve the herd.</strong></p>\r\n<p style=\"text-align: center;\"><strong>We always have Polled Hereford Bulls and Polled Hereford Females for sale, we welcome visitors at any time.</strong></p>\r\n<p style=\"text-align: center;\"><strong> Please <a href=\"../../../contact\">Contact us</a>&nbsp;with any questions.</strong></p>','/img/headings/1490824888-Fabb Herd news.jpg'),
	(3,'News','Hereford Heifers and Bulls | Polled Hereford Cattle News | Fabb herd','news','Keep up to date with our latest news and stories about the Polled Hereford Cattle, including Heifers, bulls and Cows from the Fabb Herd. Hereford breeders based in Cambridgeshire.','<p>The Latest Polled Hereford News</p>\r\n<p>{_news_}</p>','/img/headings/1485719070-Polled Hereford News.jpg'),
	(4,'Herd Sires','Hereford Sires UK | Fabb Herd Pedigree Herefords','cattle/herd-sires','Poll Hereford Bulls are selected to improve a Particular traits in the Herd. See details of our Polled Hereford Sires currently in use on our Cambridgeshire Farm.','<p><strong>The Poll Hereford Bulls are selected to improve particular traits in our Herd. Our main priorities are Milk, Muscle and Calving ease. Our Current Herd sires are Moeskaer Pacman and Moeskaer Crossfire. Both these Bulls to us, represent the direction the Hereford Breed should be heading. We Have offspring from both these Hereford Bulls available in 2017.</strong></p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>CLICK ON PICTURES BELOW FOR FURTHER DETAILS</strong></span></p>\r\n<p>{_cattle_}</p>','/img/headings/1478462330-crossfire2.jpg'),
	(5,'AI Sires','Hereford AI Sires, Bulls | Top Quality Polled Hereford Genetics | Fabb Herd','cattle/ai-sires','We offer Hereford Ai Sires, Bulls For Sale UK. We use top Hereford Genetics from around the world, talk to us about you requirements.','<p><strong>Top Quality Polled Hereford Genetics from around the World. Selecting Hereford Bulls to bring beneficial traits to our Herd. Exciting outcross Hereford Genetics to suit our wide variation of Polled Hereford Females. We have used 12 Ai Sires during the past 2 years. These have been selected to try and improve traits, in the Hereford Heifer or Hereford Cow they are being used on. The use of Ai Sires enables us to use Hereford Bulls which are suitable matched to the female being served. It would be impossible to do this using Hereford bulls alone, and allows us to bring in outcross genetics to the herd with ease.&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>CLICK ON PICTURES BELOW FOR FURTHER DETAILS.</strong></span></p>\r\n<p>{_cattle_}</p>','/img/headings/1490824255-Fabb Herd AI.jpg'),
	(6,'Females','Hereford Heifers | Polled Hereford Cows, Females and Calves | FABB Herd','cattle/females','Take a look at the Fabb Herd Females. Weâ€™ve around 60 Polled Hereford Cows, in the herd at present on our Cambridgeshire farm.','<p><strong>Polled Hereford Female Families, selected for there fertility, paternal instinct and milk. We have Dams from some of the top Polled Hereford Females in Canada, Denmark and the UK. We have imported over 20 Hereford Heifers and Hereford Cows over the past 3 years. Along with a large amount of embroys. This has given us a wide varity of unique Hereford Females not often seen in uk herds. Sires are carefully selected to best suit the Hereford heifer or Hereford Cow. We have Hereford Calves from a wide range of gentics, herd repalcements are selected from these. We always have Top quality Hereford Females for sale.&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>CLICK ON PICTURES BELOW FOR FURTHER DETAILS.</strong></span></p>\r\n<p>{_cattle_}</p>','/img/headings/1463595844-1461622814-Fabb Herd Polled Herefords.jpg'),
	(7,'For Sale','Polled Hereford Bulls For Sale | Fabb Herd Pedigree Herefords','cattle/for-sale','Polled Hereford Bulls, Females, Genetics and Hereford Calves, bulls and Heifers are always available for sale. We are Happy to flush any Hereford Females to selected Sires.','<p><strong>Polled Hereford Bulls, Females, Genetics are always available, we are Happy to flush any Hereford Females to Selected Sire. We always have a good selection of Polled Hereford Calves both Bulls and Heifers for sale, from a wide range of genetics. This gives our customers a good variety of outcross Bulls. We are happy to arrange fertiltity testing for any of the Polled Hereford Bulls we have for sale. We have semen Available from a selction of Polled Hereford Bulls.</strong></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"text-decoration: underline;\">CLICK ON PICTURES BELOW FOR FURTHER DETAILS.</span></strong></p>\r\n<p style=\"text-align: left;\">{_cattle_}</p>','/img/headings/1436052707-BG-1.jpg'),
	(8,'Blog','Blog | Fabb Herd Pedigree Herefords','blog','Know about the latest goings on, news and information on Hereford Cattle and Hereford Genetics. Polled Herefords from the Fabb Herd Polled Herefords.','<p>Polled Hereford News and Information, from the Fabb Herd Polled Herefords. Keep up to date with all the latest goings on in the Hereford Cattle World!</p>\r\n<p>&nbsp;</p>\r\n<p>{_posts_}</p>','/img/headings/1463517310-Polled Hereford Cattle.JPG'),
	(9,'Contact','The FABB Herd | Contact Us','contact','Wilsons Orchard Farm, Fenside Rd, Warboys, CAMBS, PE28 2TY. Our farm is located in Cambridgeshire. Contact us to know more about our Pedigree Hereford Cattle.','<center><strong>Fabb Herd Polled Herefords</strong></center><center><strong>Wilsons Orchard Farm,</strong><br /><strong>Fenside Road,</strong><br /><strong>Warboys,</strong><br /><strong>Cambs</strong><br /><strong>PE28 2TY</strong></center><center><strong>Tel 01487 822224</strong></center><center><strong>Mobile 07584 035080</strong></center><center><strong>helen@fabbherd.com</strong></center><form id=\"contact-form\" action=\"/contact.php\" method=\"post\">\r\n<h3>Please fill in the form below to send us a message and we will reply to you as soon as possible where appropriate.</h3>\r\n<input name=\"name\" type=\"text\" placeholder=\"Name\" data-required=\"true\" /><br /> <input name=\"email\" type=\"text\" placeholder=\"Email address\" data-required=\"true\" /><br /> <input name=\"phone\" type=\"text\" placeholder=\"Phone number\" data-required=\"false\" /><br /> <textarea name=\"message\" placeholder=\"Message\" data-required=\"true\"></textarea><br /> <input name=\"submitted\" type=\"hidden\" value=\"TRUE\" /> <input name=\"send\" type=\"button\" class=\"g-recaptcha\"\ndata-sitekey=\"6LfnJ0gUAAAAAMtzj0o1I8pc8FoK5d_vRlUO3nrV\"\ndata-callback=\"contactSubmit\" value=\"Send Message\" /></form>\n<script src=\'https://www.google.com/recaptcha/api.js\'></script>\n<script type=\"text/javascript\">\nfunction contactSubmit() {\n  $(\'#contact-form\').submit();\n};\n</script>','/img/headings/1490824495-Fabb Herd Feed Time.jpg');
INSERT INTO `tbl_posts` (`id`, `title`, `page_title`, `url`, `date`, `description`, `html`, `date_added`)
VALUES
	(1,'Polled Herefords','Polled Hereford bulls','polled-hereford-bull','2016-05-09','Polled hereford Bull sold to local cambridgeshire commercial suckler herd.','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Fabb Herd Polled Herefords Blackwell 1 Hector</strong></span></p>\r\n<p style=\"text-align: center;\"><img src=\"../../../img/Fabb%20Herd%20Polled%20Hereford%20Hector.JPG\" alt=\"Polled Hereford Bull\" width=\"688\" height=\"516\" /></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Hector&nbsp;<a href=\"../../../\">Polled Hereford Bull</a> has been one of our stock bulls, serving our commercials for the last 4 years. We are really pleased that now his time has come to move on he isnt going far!&nbsp; Being&nbsp; one of our foundation bulls at the&nbsp;<a href=\"../../../\">Fabb Herd</a> it will still be extremely sad to see him leave. </p>','2016-05-09 22:48:33'),
	(2,'Fabb 1 Mad Hatter reserve breed champion','Kathy Fenn takes Reserve Breed Champion at Notts Show','Reserve-breed-Champion-Notts','2016-05-17','Young Hereford Heifer Purchased from the Fabb Herd Polled Herefords takes Reserve Breed Champion at Nottinghamshire County Show. Excellent result for Kathy Fenn at her first show.','<p>The&nbsp;<a href=\"../../../\">Fabb herd</a> is delighted with the result of Nottinghamshire County Show. Fabb 1 Mad Hatter was Placed as Reserve Breed Champion with her new owner Kathy Fenn.</p>\r\n<p><img src=\"../../../img/kathy%20Notts%20Show.jpg\" alt=\"Reserve Breed Champion\" width=\"363\" height=\"519\" /></p>\r\n<p>Fabb 1 Mad Hatter and Fabb 1 Miss Sunshine, where purchased from the<a href=\"../../../\"> Fabb Herd Polled Herefords</a> back in March. Kathy, Ann and Dave Fenn where looking for good quality <a href=\"../../../cattle/females\">Hereford Heifers</a>, to start there own Pedigree&nbsp;<a href=\"../../../cattle/females\">Polled Hereford</a> Herd. We wish Kathy and Jupiter Herefords all the best for the Future.</p>','2016-05-17 19:33:02'),
	(3,'Polled Hereford -Fabb Herd 2015 Shows','Fabb Herd Polled Hereford, Breeders and Genetics for Canada, Denmark and Uk','shows-15','2016-05-28','The highlights of our 2015 Show season. Pedigree Polled Hereford Bulls and Heifers always available. Outcross Genetics sourced from Europe and Canada. Our ethos is Muscle and Milk, strong growth rates with small birth weights. We Have around 60 cows of which a large percentage a served by AI. This enables us to keep a diverse, and wide range of Young Hereford Heifers, and Hereford Bulls available for sale.','<p style=\"text-align: center;\"><img src=\"../../../img/Shows%202015.png\" alt=\"\" width=\"912\" height=\"1293\" /></p>','2016-06-05 20:41:24'),
	(4,'Hereford Bull Suffolk Show Success','Hereford Bull Suffolk Show','Hereford Bull','2016-06-07','Hereford Bull from Fabb Herd, Male Champion Hereford at Suffolk Show 2016.','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong><a href=\"../../../cattle/for-sale#Fabb-1-Macbeth\">Fabb 1 Macbeth</a>&nbsp;takes Male Champion Hereford at <a href=\"http://suffolkshow.co.uk\">Suffolk show</a>&nbsp;2016.&nbsp;</strong></span></p>\r\n<p style=\"text-align: center;\">Fabb 1 Macbeth, Polled <a href=\"../../../cattle/ai-sires\">Hereford Bull</a>&nbsp;at 13 months of age. His weight at 12 months was 670kg.</p>\r\n<p><img src=\"../../../img/DAN_8148.jpg\" alt=\"\" width=\"100%\" /></p>\r\n<p style=\"text-align: center;\">The Fabb Herd has a selection of&nbsp;<a href=\"../../../cattle/for-sale\">Polled Hereford Bulls for sale</a>&nbsp;including Fabb 1 Macbeth.</p>\r\n<p style=\"text-align: center;\">Bulls also available for Canadian sire Wll Global Force 7X</p>\r\n<p style=\"text-align: center;\">Please <a href=\"../../../contact\">Contact us</a>&nbsp;for an further information.</p>','2017-06-12 20:19:55'),
	(5,'National Hereford Calf Show','Hereford Calf Show Agri Expo','Hereford Calf Show','2016-10-30','Fabb Herd Polled Herefords achieve great Result at National Hereford Calf Show at Agri Expo 2016','<p><img src=\"../../../img/Fabb%201%20Noah.jpg\" alt=\"\" width=\"1026\" height=\"683\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Fabb 1 Noah.</strong></span></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"text-decoration: underline;\">Reserve Male Champion National Hereford Calf Show 2016</span></strong></p>','2016-10-30 21:35:28'),
	(6,'Moeskaer Crossfire','Polled Hereford Bull returns to Fabb Herd Polled Herefords.','Moeskaer Crossfire Fabb Herd','2017-01-05','Semen collection from Moeskaer Crossfire goes well for Fabb Herd Polled Herefords.','<p style=\"text-align: left;\">After a busy time on Stud at Uk Sires, we are delighted to have Moeskaer Crossfire back home at Fabb Herd <a href=\"http://www.fabbherd.com\">Polled Herefords</a>. We managed to collect around 2500 straws of EU qualifiying Polled Hereford Semen. This will be used in AI and Flushing on our Polled Hereford Herd. A limited quanity will be sold to other Polled Hereford Breeders from around the world. Moeskaer Crossfire offers Power, Muscle and low bith weights. This along with impressive 200 and 400 day weights. With his first Polled Hereford Calves being born at an average of 33kg. We are really excited to see more of his offspring in the Future. Please contact <a href=\"mailto:Helen@fabbherd.com\">Helen@fabbherd.com</a>&nbsp;if you require any addtional information.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;<img src=\"../../../img/headings/1478462330-crossfire2.jpg\" alt=\"\" width=\"804\" height=\"536\" /> &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>','2017-06-08 20:24:15'),
	(7,'Facts You Should Know Before Buying a Hereford Bull.','Facts you Should Know Before Buying Hereford Bull','Before-Buying-Hereford-Bull','2017-03-09','Facts you should know before Buying Hereford Bulls. Important points that should be noted before purchasing a Bull.','<p class=\"p1\" style=\"text-align: center;\"><span class=\"s1\"><span style=\"text-decoration: underline;\"><strong>Facts You Should Know Before Buying Hereford Bulls</strong></span>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; </span></p>\r\n<p class=\"p2\"><span class=\"s1\">If you&rsquo;re heading in the direction of cattle farming for whatever purpose you have for it there are a large number of choices you can make depending on what your expected outcome will be. Hereford cattle are definitely a great way to make decent profit from beef farming, and if done right, you can expect yields for years to come from the same herd, and more specifically, the bulls that produce the calves that will make your herd strong and profitable for years to come.</span></p>\r\n<p class=\"p2\"><span class=\"s1\">There are a number of very specific things you should know when buying<a title=\"Hereford Bulls\" href=\"../../../cattle/ai-sires\"> <span class=\"s2\">Hereford Bulls</span></a>, and they include a solid knowledge of the breed itself, beginning with their attributes. </span></p>\r\n<ol class=\"ol1\">\r\n<li class=\"li3\"><span class=\"s1\">Throughout its history the Hereford has retained a distinguishing white face and red coat. </span></li>\r\n<li class=\"li3\"><span class=\"s1\">Even cross-bred Hereford cattle feature a white face, which offers an advantage for stress-free traceability and future predictability. </span></li>\r\n<li class=\"li3\"><span class=\"s1\">As a breed they are well suited to grass based diets and as grass is the most economical form of feed, it dramatically improves financial returns. </span></li>\r\n<li class=\"li3\"><span class=\"s1\">Beef produced from grass feed animals offers a longer shelf life &amp; better colour, is high in omega-3 and has a unique taste. </span></li>\r\n<li class=\"li3\"><span class=\"s1\">Hereford cows are renowned for their good temperament and less stress during marketing also enhances beef quality.</span></li>\r\n<li class=\"li3\"><span class=\"s1\">Great visible characteristic variability means that the Hereford is an animal capable of adapting to various types of production systems and environmental conditions, which is great if you have plans for export. </span></li>\r\n<li class=\"li3\"><span class=\"s1\">Herefords have by tradition been prominent in the dairy sector because of their ease of calving; which has resulted largely in amplified calf crops and lower veterinary costs.</span></li>\r\n<li class=\"li3\"><span class=\"s1\">Herefords are productive breeders, which is a very important profitability characteristic.</span></li>\r\n<li class=\"li3\"><span class=\"s1\">Hereford bulls and breeding females also have a great prolonged existence, and are able to produce calves for many years.</span></li>\r\n<li class=\"li2\"><span class=\"s1\">Herefords finished off grass, produce an outstanding \'marbled\' beef that is in prodigious demand both within the UK and for export. Its distinctive flavour and renowned eating quality comes with premium value at retail level and delivers improved returns to farmers. </span></li>\r\n</ol>\r\n<p class=\"p2\"><span class=\"s1\">Now that you know a few of the basics on the breed, what are the factors that you should be wary of that could cause issues with bringing a Hereford bull into your herd? </span></p>\r\n<p class=\"p2\"><span class=\"s1\">Diseases are easily transmitted through new animals that have been introduced to existing herds, so it is a really good idea to ensure the new bulls being introduced to your herd are either virgins or have been tested for Bovine Trichomoniasis if you live in a &ldquo;trich&rdquo; area. Trichomoniasis is a venereal disease of cattle, characterised primarily by early pregnancy loss and, occasionally, by abortion and pyometra. The disease is spread between cows, by bulls. Any bull found with the disease should be culled; however cows can self-clear from the disease within around 120 days. Trich is a distressing disease that is spreading to areas where it once was rare or even completely absent.</span></p>\r\n<p class=\"p2\"><span class=\"s1\">Be sure to ask precise questions about diseases you want to avoid bringing into your herd. If the seller doesn&rsquo;t freely give information relating to any diseases, just walk away. </span></p>\r\n<p class=\"p2\"><span class=\"s1\">Buy genetics that fit your herd objectives. If you&rsquo;re mating bulls with virgin heifers, calving ease should be a high priority. For bulls to be mated with cows, you should buy a bull with growth, carcass and maternal traits that fit your objectives. </span></p>\r\n<p class=\"p4\"><span class=\"s1\">Buy a bull for cows that will improve hybrid vigour or health, growth and carcass. Calves should be born quickly and stand to nurse on their own within 30 minutes. Anything less shouldn&rsquo;t be acceptable. Ask about calf vigour before you buy.</span></p>\r\n<p class=\"p4\"><span class=\"s1\">Quarantine your new bulls for at least 30 days to ensure no pathogen exposure is visible. <a title=\"Hereford Bulls\" href=\"../../../cattle/ai-sires\"><span class=\"s2\">Hereford bulls</span></a>&rsquo; immune systems fight off diseases that you may have never known they were exposed to. 30 days of quarantine is a small price to pay for an enhanced bull health.</span></p>\r\n<p class=\"p4\"><span class=\"s1\">Conduct a breeding soundness examination on all the bulls before every breeding season. Investing in the breeding future of your herd is a crucial step in its health and essentially, its profitability. Be sure to spend adequate time analysing your options before investing.</span></p>','2017-09-25 20:28:37'),
	(8,'What You Need to Know Before Buying Hereford Cattle.','Before Buying Hereford Cattle for sale','What You Need to Know before Buying Hereford Cattle','2017-03-25','What you Need to Know Before Buying Hereford Cattle. The thing to look for before buying  Hereford Cattle for sale.','<p class=\"p1\"><span class=\"s1\">What You Need To Know Before Buying Hereford Cattle?</span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p3\"><span class=\"s1\">Hereford beef cattle are enduring creatures that can convert grasslands into high-quality beef. Whether you are making the choice to own cattle to stock your own freezer or to start a new herd of cattle to sustain your own property for the next few decades, Hereford beef is one of the lowest maintenance options for cattle farming that you can get.</span></p>\r\n<p class=\"p3\"><span class=\"s1\">No matter what your objective is, your cattle rely on you for survival, and if you are in it as a profitable venture, then you really need to understand the breed, and how to look after them. </span></p>\r\n<p class=\"p3\"><span class=\"s1\">Select Healthy Hereford Cattle</span></p>\r\n<p class=\"p3\"><span class=\"s1\">When searching for <a href=\"../../../\"><span class=\"s2\">Hereford cattle for sale</span></a>, you will be best to go through registered breeders or find auctions close to your property to make ease of access and transport a priority. When raising beef cattle, you want to select healthy animals and make the transition to your property as smooth as possible. </span></p>\r\n<p class=\"p3\"><span class=\"s1\">Here are some tips to remember when buying <a href=\"../../../\"><span class=\"s2\">Hereford Cattle</span></a>:</span></p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Your Property</strong></span></p>\r\n<p class=\"p3\"><span class=\"s1\">Prepare your property before bringing home your cattle.&nbsp;They will need grazing areas with a good fence, some form of shelter against weather, and clean eating and loafing areas. It&rsquo;s essential to create a low maintenance area for your cattle, and eliminate any items that may cause injury to your stock. Herefords are well suited to grass based diets and as grass is the cheapest form of food, it will guarantee better financial returns. Beef produced from grass has a longer shelf life and a better colour, is high in omega-3 and has a distinguishing flavour.</span></p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Purchase Healthy Animals&nbsp;</strong></span></p>\r\n<p class=\"p3\"><span class=\"s1\">If you are serious about cattle farming, you will have a veterinarian on hand that you can help with the choosing of your herd. Your cattle should be alert; their eyes should be bright, clear, and free of discharge. They should not show any signs of irregular breathing and they shouldn&rsquo;t show any signs of coughing. The animal&rsquo;s carcass should have solid structure, be full and rounded, not shrunken or hollowed out. All Herefords should be tested for trich and other diseases before purchasing. Cattle with mucus coming from the nose or that have swollen legs or joints should be avoided because these are warning signs of illness or infection, which can be passed to other cattle.</span></p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Prepare Your Transport&nbsp;</strong></span></p>\r\n<p class=\"p3\"><span class=\"s1\">The inside of your transport for your Herefords should be cleaned and sanitised, free from dirt of other matter from previous transporting of stock. Diseases can easily be spread through transport trailers, so it&rsquo;s better to be sanitised and safe than sorry.</span></p>\r\n<p class=\"p3\"><span class=\"s1\">Being transported is a stressful event for cattle, so be calm and take your time through the transporting stage. </span></p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Quarantine for 30 Days</strong></span></p>\r\n<p class=\"p3\"><span class=\"s1\">When the new animals arrive at your property, it is essential to keep them separate from any of your existing herd for around 30 days, to ensure any unknown diseases or infections are not spread to your already settled stock. </span></p>\r\n<p class=\"p3\"><span class=\"s1\">The quarantine process reduces the spread of disease through direct contact, air, feed, water, and traffic. Hereford cattle may need to be isolated between 30 and 120 days depending on the diseases that are common in your location. Your vet will assist with recommendations.</span></p>\r\n<p class=\"p3\"><span class=\"s1\">Yard your new arrivals in a secure holding lot and make sure any injuries are tended to immediately. The smaller the size of your holding lot, the less chance there is that your new cattle will get stressed, which decreases the opportunity to escape. Stock the yard with quality feed and plenty of clean water. </span></p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Feeding and Watering Your Herefords</strong></span></p>\r\n<p class=\"p3\"><span class=\"s1\">Grass fed beef is a great way to add full value at the end of line retail sector for beef Herefords but there are some times where you will need to switch foods to grain or other sources, so if you know that a change is needed, it is safest for your herd to gradually add in changes rather than all at once. Like most other animals, cows have sensitive stomachs, so a sudden switch in feed can harm the helpful bacteria in the digestive tract and cause an unsafe change in their digestive pH levels.</span></p>\r\n<p class=\"p3\"><span class=\"s1\">Grains feeding your cattle can include corn, oats, wheat, and barley, which are good sources of energy for your cattle. Soybean and cottonseed meal supply energy and protein. You can also add vitamins and minerals to your cattle&rsquo;s diet to increase their productivity.&nbsp;Always ensure your cattle have access to a clean, fresh and plentiful source of water.&nbsp;</span></p>','2017-06-08 20:20:20'),
	(9,'How to Identify a Hereford Cows and Hereford Bulls','How to Identify a Hereford Cow and Hereford Bulls','How to Identify a Hereford Cows and Hereford Bulls','2017-06-06','How to Identify a Hereford cows and Hereford Bulls from other Cattle Breeds. The white face advantage of the Hereford Breed.','<p class=\"p1\"><span class=\"s1\"><strong>How To Identify A Hereford</strong></span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p3\"><span class=\"s1\">If you&rsquo;re looking at expanding into the beef market, going for Herefords is a good choice. But how do you know what one looks like without asking someone?<span class=\"Apple-converted-space\">&nbsp; </span>If you went to a cattle auction, would you be able to tell a Hereford from an Angus or Brahman?&nbsp;</span></p>\r\n<p class=\"p4\">&nbsp;</p>\r\n<p class=\"p3\"><span class=\"s1\">This guide should tell you all you need to know about picking a Hereford out of a herd of cattle.<span class=\"Apple-converted-space\">&nbsp; </span>Often Herefords are confused with Limousine and Simmental cattle from a distance, due to similar colourations and/or body shapes.<span class=\"Apple-converted-space\">&nbsp; </span>Herefords are usually smaller than these other breeds though.</span></p>\r\n<p class=\"p5\">&nbsp;<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../img/Fabb%201%20Noak%202.jpg\" alt=\"\" width=\"573\" height=\"431\" /></p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Colour</strong></span></p>\r\n<p class=\"p3\"><span class=\"s1\"><br /> The first thing you&rsquo;ll be looking for is their colour.<span class=\"Apple-converted-space\">&nbsp; </span><a href=\"../../../\"><span class=\"s2\">Hereford cows</span></a> are always a combination of red and white.<span class=\"Apple-converted-space\">&nbsp; </span>The shade of red is anywhere from a deep red (like a cherry) to a more burnt-orange red.<span class=\"Apple-converted-space\">&nbsp; </span>Any other colour (such as black), and you&rsquo;re looking at a different breed.<span class=\"Apple-converted-space\">&nbsp; </span>It also depends on &ldquo;where&rdquo; the colours are.<span class=\"Apple-converted-space\">&nbsp; </span>A Hereford is usually red on top, and white from the face to the belly.<span class=\"Apple-converted-space\">&nbsp; </span>Also a Hereford usually has four white &ldquo;stockings&rdquo; on its feet.<span class=\"Apple-converted-space\">&nbsp; </span>How much white vs red, will depend on the cow itself.<span class=\"Apple-converted-space\">&nbsp; </span>But a general rule of thumb, is that the front of the face, all the way to the lower belly will be white.<span class=\"Apple-converted-space\">&nbsp; </span>Most Herefords also have a white stripe going along their withers (the spine above the front shoulders).<span class=\"Apple-converted-space\">&nbsp; </span>Occasionally the ears will also be white.<span class=\"Apple-converted-space\">&nbsp; </span>However, Herefords don&rsquo;t have white spots, so keep an eye out for that.</span></p>\r\n<p class=\"p5\">&nbsp;</p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Body</strong></span></p>\r\n<p class=\"p3\"><span class=\"s1\"><br /> Herefords aren&rsquo;t the largest of cow breeds, but they aren&rsquo;t the smallest either.<span class=\"Apple-converted-space\">&nbsp; </span>Their bodies are quite block, but not as defined as other breeds.<span class=\"Apple-converted-space\">&nbsp; </span>The bulls are larger and more muscular than the cows, but they&rsquo;re still smaller than some other breeds (with the exception of a few ranches that focus on breeding large Herefords).<span class=\"Apple-converted-space\">&nbsp; </span>Herefords have short hair.<span class=\"Apple-converted-space\">&nbsp; </span>Sometimes it&rsquo;s straight, sometimes it&rsquo;s curly but it&rsquo;s usually short.<span class=\"Apple-converted-space\">&nbsp; </span>The colder the ranch they come from though, the longer the hair on the Hereford will be.<span class=\"Apple-converted-space\">&nbsp; </span>Cows generally end up weighing around 1200lb, and bulls can go up to 2000lb.<span class=\"Apple-converted-space\">&nbsp; </span>Herefords tend to put on fat a lot easier than other breeds of european cattle (such as the Limousine and Simmental cattle).</span></p>\r\n<p class=\"p5\">&nbsp;</p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Face</strong></span></p>\r\n<p class=\"p3\"><span class=\"s1\"><br /> The face of a Hereford usually gives it away if there&rsquo;s any doubt as to the breed.<span class=\"Apple-converted-space\">&nbsp; </span>The white face is the first indication that you might be dealing with a Hereford.<span class=\"Apple-converted-space\">&nbsp; </span><a href=\"../../../\"><span class=\"s3\">Hereford bulls</span></a> almost always have curly hair on their foreheads, as well as both the bulls and cows have rather broad foreheads.<span class=\"Apple-converted-space\">&nbsp; </span>Their upper lips also always overlap the bottom lips, which means that Herefords almost always have a broad mouth.<span class=\"Apple-converted-space\">&nbsp; </span>In terms of horns, Herefords are usually polled (born without horns), or if they are born with horns, they are dehorned at a young age.<span class=\"Apple-converted-space\">&nbsp; </span>If not dehorned, the horns are usually trained to grow downwards, but if left to grow naturally, the horns grow upwards and forwards.</span></p>\r\n<p class=\"p5\">&nbsp;</p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Location</strong></span></p>\r\n<p class=\"p5\">&nbsp;</p>\r\n<p class=\"p3\"><span class=\"s1\">Herefords are a very hardy breed, with thick skin and coats which adapt to their environmental elements.<span class=\"Apple-converted-space\">&nbsp; </span>Because of this, they can be found everywhere from hot and sunny South Africa, to hot and dry Australia, to the cold and snowy ranches of Canada.<span class=\"Apple-converted-space\">&nbsp; </span>Something that adds to the hardiness of a Hereford is that they can live off of grass and hay, without *needing* extra supplements.<span class=\"Apple-converted-space\">&nbsp; </span>Because of this, they can be found pretty much anywhere in the world.<span class=\"Apple-converted-space\">&nbsp; </span>However, it can be noted that originally, Herefords came from Great Britain, with its wet and somewhat colder climate. </span></p>\r\n<p class=\"p5\">&nbsp;</p>\r\n<p class=\"p3\"><span class=\"s1\"><strong>Other Information</strong></span></p>\r\n<p class=\"p3\"><span class=\"s1\"><br /> Herefords are known to be quite docile and calm in temperament.<span class=\"Apple-converted-space\">&nbsp; </span>Because of this, they&rsquo;re popular on farms.<span class=\"Apple-converted-space\">&nbsp; </span>However they are poor milk producers, so they lose in the &ldquo;family farm cow&rdquo; category to cows such as Jersey cows (also calm and docile in temperament).<span class=\"Apple-converted-space\">&nbsp; </span>Generally these cows are bred for culling, as living out on farms eating grass rather than in stalls tends to give the meat a lot more flavour than grain-fed beef.</span></p>\r\n<p class=\"p5\">&nbsp;</p>','2017-06-08 20:11:31'),
	(10,'Rutland Show Success','Young Hereford Heifer success at Rutland Show','Herefords Rutland Show 2017','2017-06-06','Fabb Herd Polled Herefords Has Successful day with Young Hereford Heifer at Rutland Show 2017','<p style=\"text-align: left;\">After missing last years Rutland Show it was great to be heading out again to one of our first shows for 2017. Taking the desision to run with quite a young show team this year. We want to be showcasing <a href=\"http://www.fabbherd.com\">Hereford cattle</a>&nbsp;we have bred and a taste of what we have for sale. &nbsp;The Team consisted of three Polled Herefords, two Heifers and a Bull. A Bull and a Heifer Sired by Moeskaer Keyman and a Heifer Sired by Days Calibre.&nbsp;</p>\r\n<p style=\"text-align: left;\">Setting off a 05:30, we arrived in good time and started the preperations. First in the ring was young Bull Fabb 1 New Direction, managing a respectful second. The second class for our team was the <a href=\"../../../cattle/females\">Young Hereford Heifers</a>&nbsp;born in the year 2016 with Fabb 1 Keepsake Norma and Fabb 1 Princess Days, these manage a 1st and 3rd respectfully. Keepsake Norma then carried on to become Female Champion, junior breed champion and Reserve Breed Champion. The journey home always seem so much quicker after a sucessful day!!!</p>\r\n<p style=\"text-align: left;\">Now to start the preperations for the Royal Highland Show 2017....</p>\r\n<p style=\"text-align: center;\"><img src=\"../../../img/Fabb%20Herd%20Herefords%20Rutland%20Show%202017.jpg\" alt=\"\" width=\"753\" height=\"569\" /></p>\r\n<p style=\"text-align: center;\"><img src=\"../../../img/Fabb%201%20Keepsake-%20Norma.jpg\" alt=\"\" width=\"757\" height=\"569\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>','2017-06-08 20:15:23'),
	(11,'Hereford Bulls Sold to NCBC Ireland Genetics','Polled Hereford bulls sold to NCBC Ireland Genetics','Polled Bulls NCBC','2017-06-08','Fabb 1 Northern Star and Fabb 1 Nutcracker Polled Hereford Bulls sold to the National Cattle Breeding Center, Ireland Genetics.','<p>Fabb Herd Polled Herefords has recently exported two <a href=\"../../../\">Polled Hereford Bulls</a>&nbsp;to the National Cattle Breeding Center, Ireland Genetics. The two bulls where pick by Rose Goulding after visiting Herds around the uk looking for suitable Bulls. After a period of isolation, blood tests and TB tests, these Young Polled Hereford Bulls where ready for export.&nbsp;</p>\r\n<p>The Fabb Herd Has 80 breeding cows and is expanding the herd further. We always have a good selection of Young Bulls and Heifers for sale. The herd is largely outcross to the UK herdbook with a large percetage of imported gentics, last year we AI\'ed cattle with semen from 12 diffrent sires. We are always travelling around the world looking for different genetics which could benifit our cows within the Herd. We think it is very important to getting the best out of every female so bull selection is of great importance. If you have any questions or requirements for Hereford Bulls or Female please contact <a href=\"mailto:Helen@fabbherd.com\">Helen@fabbherd.com</a>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../img/Fabb%201%20Northern%20Star.jpg\" alt=\"\" width=\"648\" height=\"439\" /></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"text-decoration: underline;\">Fabb 1 Northern Star</span></strong>. Dam- Fabb 1 Snowdrop. Sire- Square-d Tortuga.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"../../../img/Fabb%201%20Nutcracker.jpg\" alt=\"\" width=\"646\" height=\"442\" /></p>\r\n<p style=\"text-align: center;\">&nbsp; &nbsp;<span style=\"text-decoration: underline;\"><strong>Fabb 1 Nutcracker</strong></span>. Dam- Moeskaer Alma. Sire- Square-d Tortuga.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>','2017-06-08 21:30:47'),
	(12,'Hereford Heifers For Sale','Hereford Heifers For Sale','Hereford Heifers For Sale','2017-06-12','A Selection of Young Hereford Heifers For Sale, available in the Autumn after weaning. Outcross breeding from imported genetics. Great cow prospects.','<p>Fabb Herd Polled Herefords has a selction of some of its best <a href=\"../../../cattle/for-sale\">Hereford Heifer&nbsp;</a>calves for sale. Outcross Genetics from out of two Stock Bulls Moeskaer Pacman and Moeskaer Crossfire. These are two great bulls which are going to put their stamp on the Hereford Breed. This Promises to put Milk and Muscle into your herd! Also a selection of AI Calves sire by Square-d Tortuga, WLL Global Force, Days Calibre, Mr Youtube, Moeskaer Keno to name but a few. Fabb herd has imported over 20 female bloodlines in the last three years. This has included 27 Breeding heifers from Denmark and Embroys from both Canada and North America. If you are looking for a new bloodline for your Herd then please feel free to contact us and come and take a look, visitors are always welcome. We have a High Health herd Johnes level 1, Lepto ,BVD and IBR free herd, with annual testing, TB4 area.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../img/Fabb%201%20Flora.jpg\" alt=\"Fabb 1 Flora\" width=\"551\" height=\"367\" /></p>\r\n<p style=\"text-align: center;\">Fabb 1 Flora.</p>\r\n<p style=\"text-align: center;\"><img src=\"../../../img/Fabb%201%20Almas%20Miracle.jpg\" alt=\"Fabb 1 Almas Miracle\" width=\"548\" height=\"365\" /></p>\r\n<p style=\"text-align: center;\">Fabb 1 Almas Miracle.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>','2017-06-14 21:03:30'),
	(13,'Hereford Bulls For Sale','Hereford Bulls For Sale','Yearling-Polled-Hereford-Bulls-For-Sale','2017-09-25','A Good selection of Young Polled Hereford Bulls, Great Breeding from a Section of Sires sourced for Canada and North America.','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Polled Hereford Yearling bulls for sale.</strong></span></p>\r\n<p style=\"text-align: center;\">Fabb Herd Polled Herfords has a Selection of <a href=\"../../../cattle/for-sale\">Polled Hereford yearling bulls for sale</a>, &nbsp;these come from some of the best hereford genetics we have been lucky enough to use. These are strong well grown bulls with excellent growth rates. They offer great potential for both Pedigree and Commercial breeders alike. At the Fabb Herd we take a great deal of time selecting Genetics Traveling around the UK, Europe and Canada looking for genetics to benefit our breeding program. We welcome all visitors to come and take a look at what we have to offer and love to show people around. Please Take a look below at a few bulls we have for sale which is just a taster of a large selection. Please click on website for further information <a href=\"http://www.fabherd.com\">www.fabherd.com</a>&nbsp;or call 01487 822224.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Fabb 1 Nathanial</strong></span></p>\r\n<p style=\"text-align: center;\">Out of one of our best breeding cows sired by Star-Lake Dandy.&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"../../../img/Fabb%201%20Nathanial%20(1).jpg\" alt=\"\" width=\"40%\" height=\"NaN\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Fabb 1 Perfect Days.</strong></span></p>\r\n<p style=\"text-align: center;\">Sired by Austrialian Bull Day Calibre G74, an embroyo calf from our Princess Cow Family. The combination has worked really well and will definatly be on the list for flushing again next year.</p>\r\n<p style=\"text-align: center;\"><img src=\"../../../img/Fabb%201%20Perfect%20Days%20(2).jpg\" alt=\"\" width=\"40%\" height=\"NaN\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Fabb 1 Pong Keno (yes there is also a brother called Ping!)</strong></span></p>\r\n<p style=\"text-align: center;\">Son of Moeskaer Keno</p>\r\n<p style=\"text-align: center;\"><img src=\"../../../img/Fabb%201%20Pong%20Keno%20(3).jpg\" alt=\"\" width=\"40%\" height=\"NaN\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p>&nbsp;</p>','2017-09-25 21:19:28'),
	(14,'Hereford Bulls For Sale','Hereford Bulls for sale','Polled-Hereford-Bulls-For-sale','2017-10-11','Selection of Bulls offered for sale form the Fabb Herd Poled Herefords, visitors always welcome.','<p style=\"text-align: center;\"><a title=\"Bulls-for-sale-2017\" href=\"../../../img/Bulls-for-sale-2017.pdf\">Bulls-for-sale-2017</a></p>\r\n<p>&nbsp;</p>','2017-10-11 22:34:23');
